function fft2(input: string): string {
    const subset = input.slice(parseInt(input.slice(0,7),10))

    let chars = subset.split('').map(i => parseInt(i, 10)).reverse()
    for (let i = 0; i < 100; i++) {
        let newChars: number[] = []
        chars.forEach((v, i) => {
            if (i == 0){
                newChars.push(v)
                return 
            }
            newChars.push((v + newChars[i-1]) % 10 )
        })

        chars = newChars
    }

    return chars.reverse().slice(0,8).join('')
}

const input = ''
const p2Input = Array(10000).fill(input).join('')
console.log(fft2(p2Input))